import React, { useState } from "react";
import { Plus, Pill, Package, BoxSelect, Calendar, Search, X } from "lucide-react";

export function ProductForm({ onAdd }) {
  const [form, setForm] = useState({
    name: "",
    price: "",
    stock: "",
    manufacturer: "",
    expiry: "",
    category: "",
  });
  const [error, setError] = useState(null);

  function handleChange(e) {
    setForm({ ...form, [e.target.name]: e.target.value });
  }

  function handleSubmit(e) {
    e.preventDefault();
    if (!form.name || !form.price || !form.stock || !form.expiry) {
      setError("Please fill all required fields.");
      return;
    }
    setError(null);
    onAdd(form);
    setForm({
      name: "",
      price: "",
      stock: "",
      manufacturer: "",
      expiry: "",
      category: "",
    });
  }

  return (
    <form onSubmit={handleSubmit} className="product-form">
      <div className="product-form-header">
        <Plus size={20} className="product-form-header-icon" />
        <h3>Add New Medicine</h3>
      </div>
      <div className="product-form-body">
        <div className="product-form-row">
          <div className="product-form-field">
            <Pill size={16} className="product-form-field-icon" />
            <input
              name="name"
              value={form.name}
              onChange={handleChange}
              placeholder="Medicine Name *"
            />
          </div>
          <div className="product-form-field">
            <span className="product-form-field-prefix">Rs.</span>
            <input
              name="price"
              value={form.price}
              onChange={handleChange}
              type="number"
              placeholder="Price *"
            />
          </div>
        </div>
        <div className="product-form-row">
          <div className="product-form-field">
            <Package size={16} className="product-form-field-icon" />
            <input
              name="stock"
              value={form.stock}
              onChange={handleChange}
              type="number"
              placeholder="Stock *"
            />
          </div>
          <div className="product-form-field">
            <BoxSelect size={16} className="product-form-field-icon" />
            <input
              name="manufacturer"
              value={form.manufacturer}
              onChange={handleChange}
              placeholder="Manufacturer"
            />
          </div>
        </div>
        <div className="product-form-row">
          <div className="product-form-field">
            <Calendar size={16} className="product-form-field-icon" />
            <input
              name="expiry"
              value={form.expiry}
              onChange={handleChange}
              placeholder="Expiry (MM/YYYY) *"
            />
          </div>
          <div className="product-form-field">
            <Search size={16} className="product-form-field-icon" />
            <input
              name="category"
              value={form.category}
              onChange={handleChange}
              placeholder="Category"
            />
          </div>
        </div>
        {error && (
          <div className="product-form-error">
            <X size={16} />
            {error}
          </div>
        )}
        <button type="submit" className="product-form-submit">
          <Plus size={18} className="product-form-submit-icon" />
          Add Medicine
        </button>
      </div>
    </form>
  );
}
